import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

const routes = [
  {
    path: '/test',
    name: 'Test',
    component: () => import(
      /* webpackChunkName: "about" */ '@/html/Test.vue')
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

// export default router


export default new VueRouter({
    routes: [
      {
        path: '/test',
        name: 'Test',
        component: () => import(
          /* webpackChunkName: "about" */ '@/html/Test.vue')
      }]
});
